// src/pages/Home.js

import React from 'react';
import { Container, Button, Row, Col } from 'react-bootstrap';
import '../styles/Home.css'; // Importando um CSS específico, se necessário

function Home() {
  return (
    <Container className="d-flex flex-column align-items-center justify-content-center vh-100">
      <h1 className="display-1">HEALTH HORIZON</h1>
      <h2 className="mt-3">SELECIONE SEU PERFIL</h2>
      <Row className="mt-4">
        <Col>
          <Button variant="primary" className="w-100 mb-2">PACIENTE</Button>
        </Col>
        <Col>
          <Button variant="secondary" className="w-100 mb-2">MÉDICO</Button>
        </Col>
        <Col>
          <Button variant="success" className="w-100 mb-2">ADMIN</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
